// InputField.js


function InputField({ id, name, type, placeholder, value, onChange }) {
      const inputStyle = {
        width: '100%',
        padding: '10px',
        marginBottom: '20px',
        borderRadius: '5px',
        border: '1px solid #ccc',
      };
    
      return (
        <input
          style={inputStyle}
          id={id}
          name={name}
          type={type}
          placeholder={placeholder}
          value={value}
          onChange={onChange}
          required
        />
      );
    }
    
    export default InputField;
